import React, { useState, useEffect, useRef } from 'react'
import css from 'styled-jsx/css'


export default function ActiveTicket() {

  return <div className='active-ticket'>
    ActiveTicket
    <style jsx>{ style }</style>
  </div>
}


// language=Stylus
const style = css`
  .active-ticket {
    background-color greenyellow
  }
`
